<!DOCTYPE html>

  <style>
    body {

        color: #2C3E50; /* Dark Blue-Grey - a deep, soft color, calmer than black or pure navy */
        display: flex;
        justify-content: center;
        align-items: center;
        min-height: 100vh;
        margin: 0;
        padding: 20px;
    }
    .container {
        background: #001F3F; /* Navy Blue - a classic, calming deep blue */
        color: #F8F8FF; /* Ghost White - soft white text color for elements inside the navy container */
        padding: 30px 40px;
        border-radius: 15px;
        box-shadow: 0 4px 15px rgba(0, 31, 63, 0.4); /* Shadow based on navy color */
        max-width: 520px;
        width: 100%;
        /* Text color inside container defaults to #F8F8FF */
    }
    h1, h3 {
        text-align: center;
        margin-bottom: 1.2rem;
        font-weight: 700;
        color: #D2B48C; /* Tan - a warm brown accent for headings, readable on navy */
    }
    .question {
        display: none;
    }
    .active {
        display: block;
    }
    label {
        display: block;
        margin: 0.7rem 0 0.3rem;
        font-weight: 600;
        /* Color is inherited from the container (#F8F8FF) */
    }
    select, input[type="number"] {
        width: 100%;
        padding: 8px 10px;
        border: 2px solid #D2B48C; /* Tan border - warm */
        border-radius: 8px;
        font-size: 1rem;
        box-sizing: border-box;
        transition: border-color 0.3s;
        color: #2C3E50; /* Input text color is the body text color */
    }
    select:focus, input[type="number"]:focus {
        border-color: #CD853F; /* Peru - a warmer brown focus */
        outline: none;
    }
    button {
        background: #CD853F; /* Peru - a warm brown button color */
        color: #FFFFFF; /* White text for good contrast */
        border: none;
        padding: 12px 0;
        width: 100%;
        margin-top: 1.5em;
        border-radius: 10px;
        font-size: 1.1rem;
        cursor: pointer;
        transition: background-color 0.3s ease;
        font-weight: 700;
    }
    button:hover {
        background: #A0522D; /* Sienna - a darker warm brown on hover */
    }
    .result {
        margin-top: 1.8rem;
        padding: 20px;
        border-radius: 12px;
        background: #F5F5DC; /* Beige - a warm neutral background for results */
        font-size: 1.1rem;
        line-height: 1.4;
        color: #2C3E50; /* Dark Blue-Grey text on the beige background */
        min-height: 80px;
        box-shadow: inset 0 0 8px #D2B48C; /* Inset shadow using the tan color */
        white-space: pre-wrap;
        text-align: center; /* Center the result text */
    }
    ul {
        text-align: left; /* Align list items to the left */
        padding: 0; /* Remove left padding */
        margin: 0; /* Remove top and bottom margin */
        line-height: 1.2; /* Reduces line height; adjust as necessary */
        /* Color is inherited from the result container (#2C3E50) */
    }

    li {
        margin: 0; /* Remove margins from list items */
        padding: 2px 0; /* Adjust top and bottom padding to control spacing */
    }
    footer {
        margin-top: 30px;
        text-align: center;
        font-size: 0.85rem;
        color: #2C3E50; /* Dark Blue-Grey footer text */
    }
  </style>
</head>

    let responses = {};
    let currentQuestion = 1;

    function nextQuestion(questionNumber) {
      const inputElement = document.querySelector(`#question${questionNumber} input, #question${questionNumber} select`);
      if (!inputElement.checkValidity()) {
        inputElement.reportValidity(); // Show validation error
        return;
      }

      responses[questionNumber] = inputElement.value; // Store response
      document.getElementById(`question${questionNumber}`).classList.remove('active'); // Hide current question
      
      // Prepare to show the next question or results
      if (questionNumber < 16) {
        currentQuestion++;
        document.getElementById(`question${currentQuestion}`).classList.add('active'); // Show next question
      } else {
        showResults();
      }
    }

    function prevQuestion(questionNumber) {
      if (questionNumber > 1) {
        document.getElementById(`question${questionNumber}`).classList.remove('active'); // Hide current question
        currentQuestion--;
        document.getElementById(`question${currentQuestion}`).classList.add('active'); // Show previous question
      }
    }

    function showResults() {
      document.getElementById(`resultSection`).style.display = 'block'; // Show results section
      const resultDiv = document.getElementById('result');

      // Convert responses to input format for prediction
      const inputValues = [
        Number(responses[1]), // Age
        responses[2] === 'Female' ? 0 : 1, // Gender
        responses[3] === 'Yes' ? 1 : 0, // Polyuria
        responses[4] === 'Yes' ? 1 : 0, // Polydipsia
        responses[5] === 'Yes' ? 1 : 0, // SuddenWeightLoss
        responses[6] === 'Yes' ? 1 : 0, // Weakness
        responses[7] === 'Yes' ? 1 : 0, // Polyphagia
        responses[8] === 'Yes' ? 1 : 0, // GenitalThrush
        responses[9] === 'Yes' ? 1 : 0, // VisualBlurring
        responses[10] === 'Yes' ? 1 : 0, // Itching
        responses[11] === 'Yes' ? 1 : 0, // Irritability
        responses[12] === 'Yes' ? 1 : 0, // DelayedHealing
        responses[13] === 'Yes' ? 1 : 0, // PartialParesis
        responses[14] === 'Yes' ? 1 : 0, // MuscleStiffness
        responses[15] === 'Yes' ? 1 : 0, // Alopecia
        responses[16] === 'Yes' ? 1 : 0  // Obesity
      ];

      // Call the score function here (integrate your model)
      const rawPrediction = score(inputValues); // Placeholder function

      if (Array.isArray(rawPrediction)) {
        const probDiabetes = rawPrediction[1]; // Assuming the second element is the probability of diabetes
        const likelihoodDiabetes = (probDiabetes * 100).toFixed(2); // Convert to percentage

        resultDiv.innerHTML = `<strong>Risk of acquiring Diabetes in next 3 years: ${likelihoodDiabetes}%</strong><br />`;

        if (probDiabetes <= 0.25) {
          resultDiv.innerHTML += `You are <strong>not</strong> at risk:
            <ul>
              <li>Adopt a balanced whole food diet, avoid processed foods</li>
              <li>Aim for at least 150-300 minutes of moderate aerobic activity per week</li>
              <li>Avoid smoking.</li>
              <li>Manage stress and anxiety</li>
            </ul>`;
        } 
	  else if (probDiabetes > 0.25 && probDiabetes <= 0.5) {
          resultDiv.innerHTML += `Recommendations for low risk:
            <ul>
              <li>Adopt a balanced whole food diet, avoid processed foods</li>
              <li>Aim for at least 150-300 minutes of moderate aerobic activity per week</li>
              <li>Avoid smoking.</li>
	      <li>Lower daily sugar consumption</li>
              <li>Manage stress and anxiety</li>
            </ul>`;
        }
	  else if (probDiabetes > 0.5 && probDiabetes <= 0.75) {
          resultDiv.innerHTML += `Recommendations for moderate risk:
            <ul>
              <li>Consult with a healthcare professional</li>
              <li>Adopt a balanced whole food diet, avoid processed foods.</li>
              <li>Monitor blood sugar.</li>
              <li>Avoid smoking.</li>
	      <li>Lose excess weight</li>
              <li>Lower daily sugar consumption</li>
              <li>Manage stress and anxiety</li>  
            </ul>`;
        }
	  else {
          resultDiv.innerHTML += `Recommendations for high risk:
            <ul>
              <li>Please consult with a healthcare professional promptly</li>
              <li>Adopt a balanced whole food diet, avoid processed foods.</li>
              <li>Aim for at least 150-300 minutes of moderate aerobic activity per week</li>
              <li>Avoid/Quit smoking.</li>
              <li>Monitor blood sugar regularly</li>
              <li>Regular health check-ups including eye & foot screening.</li>
	      <li>Reduce sedentary time & lose excess weight</li>
	      <li>Manage stress and anxiety</li> 
            </ul>`;
        }
      } else {
        resultDiv.innerHTML = `Unexpected prediction value: ${rawPrediction}`;
      }
    }

      const questions = document.querySelectorAll(".question");

    }
